var $bm_rt;
var n, n, t, t, v, amp, freq, decay;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = sub(time, key(n).time);
}
if (n > 0) {
    v = velocityAtTime(sub(key(n).time, div(thisComp.frameDuration, 10)));
    amp = div(effect('Rotation - Overshoot')('Slider'), 2.5);
    freq = div(effect('Rotation - Bounce')('Slider'), 20);
    decay = div(effect('Rotation - Friction')('Slider'), 20);
    $bm_rt = sum(value, div(mul(mul(div(v, 100), amp), Math.sin(mul(mul(mul(freq, t), 2), Math.PI))), Math.exp(mul(decay, t))));
} else {
    $bm_rt = value;
}

